import { ColumnString, PieceID, RowNumber, Tile } from "../types";

const createTile = (
  d: boolean,
  tile: [ColumnString, RowNumber],
  piece?: PieceID
): Tile => ({
  dark: d, tile, piece
});

export default createTile;
